import React from 'react'
import ReactDOM from 'react-dom'
const fname= "Tanu";
const lname="Pahadi";
const img= "https://picsum.photos/200/300";
const img1= "https://picsum.photos/208/300";
const img2= "https://picsum.photos/250/300";
const img3= "https://picsum.photos/290/300";
const img4= "https://picsum.photos/280/300";
const link="www.google.com";
ReactDOM.render(
  <>
  <h1 class>{`Hello my name is ${fname} ${lname} `}</h1>
  <img src={img} alt="random"/>
  <img src={img1} alt="random"/>
  <img src={img2} alt="random"/>
  <img src={img3} alt="random"/>
  <a  href={link} target="_blank">
  <img src={img4} alt="random"/>
  </a>
  </>,
  document.getElementById('root'));
